head.ready(function(){$(".js-slick").slick({infinite:!0,slidesToShow:6,slidesToScroll:6,dots:!1,arrows:!0});var t=$(".js-window");$(".js-window-toggle").hover(function(){var i=$(this).attr("href"),o=$('[data-window="'+i+'"]'),s=$(this).offset().left,e=$(this).offset().top;t.hide(),o.css({left:s-$(this).outerWidth()/2,top:e-o.outerHeight()}),o.fadeIn(200)},function(){t.hide()})});